#  usado para pesquisar os personagens na minha API, como tem poucos, vai ter poucas op√ß√µes, e √© por isso que a proxima fun√ß√£o √© adicionar um novo
@app.get("/personagens/{personagem_id}")
def buscar_personagem(personagem_id: int):
    if personagem_id not in personagens:
        raise HTTPException(status_code=404, detail="Personagem n√£o encontrado")
    return personagens[personagem_id]


# aqui como dito l√° em cima, eu posso add um champion novo quando eu quiser, menos Yuumi, Yasuo, Zed, Garen, Teemo, Lux, Ahri, Ezreal e Seraphine maldita
@app.post("/personagens", status_code=status.HTTP_201_CREATED)
def adicionar_personagem(personagem: PersonagensLeagueOfLegends):
    novo_id = max(personagens.keys()) + 1 if personagens else 1
    personagens[novo_id] = personagem.dict()
    return {"id": novo_id, "mensagem": "Personagem adicionado com sucesso"}


# aqui posso modificar um champion que eu ja tenho e atualizar ele na minha API, ent√£o tipo, ta l√° ja, mas ta errado e tals
# ai eu vou la e conserto, arrumo bonitinho e paaaaa
@app.put("/personagens/{personagem_id}")
def atualizar_personagem(personagem_id: int, personagem: PersonagensLeagueOfLegends):
    if personagem_id not in personagens:
        raise HTTPException(status_code=404, detail="Personagem n√£o encontrado")
    personagens[personagem_id] = personagem.dict()
    return {"mensagem": "Personagem atualizado com sucesso"}


#  Aqui vou deletar meu champion quando eu quiser, se for um Yasuo ou uma Yuumi por favor deletar com for√ßa e proibir de entrar na minha API, me recuso a dar palco pra champion de gente doida 
@app.delete("/personagens/{personagem_id}", status_code=status.HTTP_204_NO_CONTENT)
def deletar_personagem(personagem_id: int):
    if personagem_id not in personagens:
        raise HTTPException(status_code=404, detail="Personagem n√£o encontrado")
    del personagens[personagem_id]
    return Response(status_code=status.HTTP_204_NO_CONTENT)
